package com.pandacreep.library.util;

import com.pandacreep.library.model.Book;
import com.pandacreep.library.model.User;
import com.pandacreep.library.repo.BooksRepository;
import com.pandacreep.library.repo.ImagesRepository;
import com.pandacreep.library.repo.UserRepository;
import org.springframework.boot.CommandLineRunner;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;

import java.time.LocalDate;
import java.util.UUID;
import java.util.stream.Stream;

@Configuration
public class PreloadDatabaseWithData {
    @Bean
    CommandLineRunner initDatabase(BooksRepository booksRepository,
                                   ImagesRepository imagesRepository,
                                   UserRepository userRepository) {
        System.out.println("Initialization of MongoDB with initial data");
        booksRepository.deleteAll();
        imagesRepository.deleteAll();
        userRepository.deleteAll();
        try {
            initBooks(booksRepository).run();
            initUses(userRepository).run();
        } catch (Exception e) {
            e.printStackTrace();
        }
        return null;
    }

    private CommandLineRunner initBooks(BooksRepository repository) {
        return (args) -> Stream.of(books())
                .peek(System.out::println)
                .forEach(repository::save);
    }

    private CommandLineRunner initUses(UserRepository repository) {
        return (args) -> Stream.of(users())
                .peek(System.out::println)
                .forEach(repository::save);
    }

    private Book[] books() {
        return new Book[]{
                new Book(UUID.randomUUID().toString(),
                        "Grammar in use", "Murthy",
                        "",
                        2012,
                        "Book to learn English", LocalDate.now().minusMonths(16)),
                new Book(UUID.randomUUID().toString(),
                        "Tea Book", "Kairat",
                        "",
                        2015,
                        "Book about tea in Kazakhstan", LocalDate.now().minusMonths(10)),
                new Book(UUID.randomUUID().toString(),
                        "Bingo", "Petr",
                        "",
                        2013,
                        "Book about super game", LocalDate.now().minusMonths(17)),
                new Book(UUID.randomUUID().toString(),
                        "All the phisics", "Enrikio",
                        "",
                        2014,
                        "Book about phisics", LocalDate.now().minusMonths(13)),
                new Book(UUID.randomUUID().toString(),
                        "Solutions", "Anna",
                        "",
                        2003,
                        "Book about solutions", LocalDate.now().minusMonths(19))
                };
    }

    private User[] users() {
        return new User[]{
                new User("anna@gmail.com", "Anna", "Petrova", "123", false),
                new User("petr@gmail.com", "Petr", "Ivanov", "234", false),
                new User("igor@gmail.com", "Igor", "Dubinin", "987", false)
        };
    }
}
